Table Auto vs Fixed Layout

    body { margin: 16px; font-family: Arial, sans-serif; }
    td, th { padding: 8px; border: 1px solid #666; background: #fff; }
    .auto-table { 
      border-collapse: separate; 
      border-spacing: 0; 
      table-layout: auto;
      margin-bottom: 20px;
    }
    .fixed-table { 
      border-collapse: separate; 
      border-spacing: 0; 
      table-layout: fixed;
      width: 400px;
    }



